def merge_the_tools(string, k):
    part_len = k
    combos = [string[i: i + part_len] for i in range(0, len(string), part_len)]

    result = [''] * len(combos)
    for i, combo in enumerate(combos):
        for letter in combo:
            if letter not in result[i]:
                result[i] += letter
    print('\n'.join(result))


merge_the_tools(
    "",
    3452)
